import React, { Component } from "react";
import houses from './Houses'
import House from './House'

class App extends Component {
  render() {
    return (
      <div>
        <h1>Houses</h1>
        {houses.map(item=>{
          <House data={item}/>  })}
        <h2>Charechters</h2>
      </div>
    );
  }
}

export default App;
